import React, { forwardRef, ForwardedRef } from 'react'

export type Props = {}

const EmojiLargeYellowSquare = forwardRef(
  (props: Props, ref: ForwardedRef<HTMLElement>) => {
    const { ...otherProps } = props

    return (
      <figure ref={ref} {...otherProps}>
        <img
          alt="Emoji-large-yellow-square"
          src="data:image/png;base64,&#x3D;"
        />
      </figure>
    )
  }
)

EmojiLargeYellowSquare.displayName = 'EmojiLargeYellowSquare'
EmojiLargeYellowSquare.defaultProps = {}

export default EmojiLargeYellowSquare
